import React, { useEffect, useState } from "react";
import axios from "axios";

export default function AdminDashboard() {
  const [schools, setSchools] = useState([]);
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [err, setErr] = useState("");

  // Get token from localStorage for auth requests
  const token = localStorage.getItem("token");

  useEffect(() => {
    // Fetch all schools and all users (admin-only endpoints)
    async function fetchData() {
      setLoading(true);
      setErr("");
      try {
        // GET all schools
        const schoolRes = await axios.get("http://localhost:5000/api/schools", {
          headers: { Authorization: `Bearer ${token}` },
        });
        setSchools(schoolRes.data.schools || schoolRes.data); // handle both array/object
        // GET all users
        const userRes = await axios.get("http://localhost:5000/api/admin/users", {
          headers: { Authorization: `Bearer ${token}` },
        });
        setUsers(userRes.data.users || userRes.data);
      } catch (error) {
        setErr(error?.response?.data?.message || "Error fetching data.");
      }
      setLoading(false);
    }
    fetchData();
  }, [token]);

  return (
    <div className="p-8 max-w-5xl mx-auto">
      <h1 className="text-3xl font-bold mb-4">Super Admin Dashboard</h1>
      {err && <div className="text-red-500 mb-4">{err}</div>}
      {loading ? (
        <div>Loading...</div>
      ) : (
        <>
          <section className="mb-8">
            <h2 className="text-xl font-semibold mb-2">All Schools</h2>
            <div className="overflow-x-auto">
              <table className="min-w-full bg-white rounded shadow">
                <thead>
                  <tr className="bg-blue-200">
                    <th className="p-2 text-left">#</th>
                    <th className="p-2 text-left">Name</th>
                    <th className="p-2 text-left">Address</th>
                    <th className="p-2 text-left">Email</th>
                    <th className="p-2 text-left">Status</th>
                  </tr>
                </thead>
                <tbody>
                  {schools.map((s, i) => (
                    <tr key={s.id || i}>
                      <td className="p-2">{i + 1}</td>
                      <td className="p-2">{s.name}</td>
                      <td className="p-2">{s.address}</td>
                      <td className="p-2">{s.email}</td>
                      <td className="p-2">{s.onboarding_status || "N/A"}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </section>

          <section>
            <h2 className="text-xl font-semibold mb-2">All Users</h2>
            <div className="overflow-x-auto">
              <table className="min-w-full bg-white rounded shadow">
                <thead>
                  <tr className="bg-green-200">
                    <th className="p-2 text-left">#</th>
                    <th className="p-2 text-left">Name</th>
                    <th className="p-2 text-left">Email</th>
                    <th className="p-2 text-left">Role</th>
                  </tr>
                </thead>
                <tbody>
                  {users.map((u, i) => (
                    <tr key={u.id || i}>
                      <td className="p-2">{i + 1}</td>
                      <td className="p-2">{u.full_name || "—"}</td>
                      <td className="p-2">{u.email}</td>
                      <td className="p-2">{u.role}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </section>
        </>
      )}
      {/* LOGOUT BUTTON */}
      <button
        className="px-4 py-2 bg-red-600 text-white rounded mt-8"
        onClick={() => {
          localStorage.removeItem("token");
          localStorage.removeItem("user");
          window.location.href = "/login";
        }}
      >
        Logout
      </button>
    </div>
  );
}
